import { defineConfig } from 'vite'
import react from '@vitejs/plugin-react'

export default defineConfig({
  plugins: [react()],
  server: {
    proxy: {
      '/slots-api': {
        target: 'https://slotslaunch.com',
        changeOrigin: true,
        rewrite: (path) => path.replace(/^\/slots-api/, '/api'),
        headers: {
          Origin: 'http://localhost:5173'
        }
      }
    }
  }
})
